Okay, let's break down the Ultimatum Game and develop a computational model for responder behavior.

**Key Psychological Mechanisms:**

1.  **Fairness:** Responders evaluate the fairness of the offer. This is influenced by both the absolute amount offered (`split_opp`) and the relative split of the total pie (`splitperc_opp`). A lower offer will trigger the sense of unfairness more.
2.  **Reference Points:** A responder's perception of fairness is not simply determined by absolute or relative amounts. Previous trials and understanding their own contributions to the shared money affects their expectations of what is fair. Contributions are represented by tokens (tokens\_self and tokens\_opp).
3.  **Loss Aversion:** Responders might be more sensitive to the potential loss of accepting an unfair offer compared to the gain of accepting a fair offer. In other words, the "pain" of accepting an unfair offer may outweigh the "pleasure" of accepting a fair one.
4.  **Inequity Aversion:** Responders may experience disutility when the outcomes are unequal, whether the inequality advantages or disadvantages them (although advantageous inequality usually has a smaller effect).
5.  **Error/Noise:** Human behavior isn't perfectly rational. There will be some degree of randomness or error in decision-making.

**Interaction of Mechanisms:**

Fairness and reference points set the stage for the responder's expectations. Loss aversion and inequity aversion then modulate the utility derived from accepting a given offer, based on how it deviates from those expectations. Noise introduces variability in the response.

**Mathematical Form:**

I will use a utility function based on inequity aversion. The utility will consider the monetary amount offered, the perceived fairness (based on token contributions and total earnings), and a sensitivity parameter.

**Model:**

The utility function will have several parts.
*A linear term for the offer amount.
*A term for the inequity - i.e. difference between offers.
*A weighting term for sensitivity to inequity.
*A noise term.

**Parameters:**

1.  **alpha (alpha):** Sensitivity to disadvantageous inequity (how much it hurts to get less than the proposer). Bounded between 0 and 10.
2.  **mu (mu):** Impact of the offer amount. Bounded between 0 and 10.
3.  **sigma (sigma):** Noise parameter. Standard deviation of a normal distribution. Bounded between 0.01 and 5.

**Variable Mapping:**

*   `split_opp`: Amount offered to the responder.
*   `split_self`: Amount offered to the proposer.
*   `token_self`: Number of tokens the responder contributed.
*   `token_opp`: Number of tokens the proposer contributed.

```
<MODEL>
